INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60000, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804, 1, 1, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 2, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 3, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 1, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 4, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 5, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 6, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 7, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 3, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 8, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 3, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 9, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 3, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 10, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 3, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 11, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 3, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 12, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 4, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 13, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 4, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 14, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 4, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 15, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 4, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 16, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60000, 4, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 17, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60000, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, 18, 0, 3, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60000, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 190804, 19, 0, 3, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ハツネ", 0, 80001, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1, 101201, 20, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ハツネ", 0, 80001, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 1, 101201, 21, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シオリ", 0, 80001, 0, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 103801, 22, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シオリ", 0, 80001, 0, "来年も、\n一緒にいられたら…\nうれしいな", 1, 103801, 23, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キョウカ", 0, 80001, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 2, 103601, 24, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キョウカ", 0, 80001, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2, 103601, 25, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミミ", 0, 80001, 0, "おにいちゃんとあってから、\n1年たったよ～！", 2, 102001, 26, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミミ", 0, 80001, 0, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 102001, 27, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミソギ", 0, 80001, 0, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 100401, 28, 0, 2, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミソギ", 0, 80001, 0, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 100401, 29, 0, 2, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("マホ", 0, 80001, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 3, 101001, 30, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("マホ", 0, 80001, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 3, 101001, 31, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("イリヤ", 0, 80001, 0, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 3, 104401, 32, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("イリヤ", 0, 80001, 0, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 3, 104401, 33, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カオリ", 0, 80001, 0, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 3, 101701, 34, 0, 2, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カオリ", 0, 80001, 0, "これからも、どうぞよろしく\nお願いするさ～！", 3, 101701, 35, 0, 2, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("サレン", 0, 80001, 0, "あんたと出会ってからもうそんなに\nたつのね～", 4, 102801, 36, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("サレン", 0, 80001, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 4, 102801, 37, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("スズメ", 0, 80001, 0, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 4, 102501, 38, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("スズメ", 0, 80001, 0, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 4, 102501, 39, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("タマキ", 0, 80001, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 5, 104601, 40, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("タマキ", 0, 80001, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 5, 104601, 41, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミフユ", 0, 80001, 0, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 5, 104801, 42, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミフユ", 0, 80001, 0, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 5, 104801, 43, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("アキノ", 0, 80001, 0, "あなたさまと出会ってもう1年…", 6, 103201, 44, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("アキノ", 0, 80001, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 6, 103201, 45, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ユカリ", 0, 80001, 0, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 6, 103401, 46, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ユカリ", 0, 80001, 0, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 6, 103401, 47, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("クリスティーナ", 0, 80001, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 7, 107101, 48, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("クリスティーナ", 0, 80001, 0, "ともかくこれからも\n愉しませてくれよ☆", 7, 107101, 49, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ジュン", 0, 80001, 0, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 7, 104701, 50, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ジュン", 0, 80001, 0, "見えないから分からないって？\nそれもそうだな…", 7, 104701, 51, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("トモ", 0, 80001, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 8, 103701, 52, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("トモ", 0, 80001, 0, "これからもよろしくね！", 8, 103701, 53, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("マツリ", 0, 80001, 0, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 8, 100501, 54, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("マツリ", 0, 80001, 0, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 8, 100501, 55, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミヤコ", 0, 80001, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 9, 100701, 56, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミヤコ", 0, 80001, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 9, 100701, 57, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シノブ", 0, 80001, 0, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 9, 103101, 58, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シノブ", 0, 80001, 0, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 9, 103101, 59, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("アンナ", 0, 80001, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 10, 100901, 60, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("アンナ", 0, 80001, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 10, 100901, 61, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ナナカ", 0, 80001, 0, "君と出会ってもう1年だって！\n早いねー！", 10, 101301, 62, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ナナカ", 0, 80001, 0, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 10, 101301, 63, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミツキ", 0, 80001, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 11, 105101, 64, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ミツキ", 0, 80001, 0, "これからも、いろんなところを\n調べさせてね？", 11, 105101, 65, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ルカ", 0, 80001, 0, "お前さんと出会ってもう1年か\n助太刀するつもりが", 11, 105601, 66, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ルカ", 0, 80001, 0, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 11, 105601, 67, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("エリコ", 0, 80001, 0, "早いものですわね、あなた様と\nお会いして、もう1年…", 11, 102701, 68, 0, 2, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("エリコ", 0, 80001, 0, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 11, 102701, 69, 0, 2, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("アヤネ", 0, 80001, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 12, 102301, 70, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("アヤネ", 0, 80001, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 12, 102301, 71, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("チカ", 0, 80001, 0, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 12, 104201, 72, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("チカ", 0, 80001, 0, "私のことを見守ってください\nできることなら、ずっと…", 12, 104201, 73, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("クルミ", 0, 80001, 0, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 12, 102101, 74, 0, 2, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("クルミ", 0, 80001, 0, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 12, 102101, 75, 0, 2, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シズル", 0, 80001, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 13, 104901, 76, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シズル", 0, 80001, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 13, 104901, 77, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("リノ", 0, 80001, 0, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 13, 101101, 78, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("リノ", 0, 80001, 0, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 13, 101101, 79, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ユイ", 0, 80001, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 14, 100201, 80, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ユイ", 0, 80001, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 14, 100201, 81, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ヒヨリ", 0, 80001, 0, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 14, 100101, 82, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ヒヨリ", 0, 80001, 0, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 14, 100101, 83, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("レイ", 0, 80001, 0, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 14, 100301, 84, 0, 2, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("レイ", 0, 80001, 0, "キミに背中を預けられる日が、\n早くきますように", 14, 100301, 85, 0, 2, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80001, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 15, 105801, 86, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80001, 0, "これからもずっと、覚えていて\nくださいね！", 15, 105801, 87, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80001, 0, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 15, 105901, 88, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80001, 0, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 15, 105901, 89, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80001, 0, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 15, 106001, 90, 0, 2, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80001, 0, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 15, 106001, 91, 0, 2, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("スズメ", 0, 60001, 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, 112101, 92, 1, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 93, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 94, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 95, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 96, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 1, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 97, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 98, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 99, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 100, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 101, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 102, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 3, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 103, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 3, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 104, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 3, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 105, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 3, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 106, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 3, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 0, 107, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 3, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 0, 108, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 3, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 109, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 4, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 110, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 4, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 111, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 4, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 112, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 4, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 113, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 4, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 114, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 4, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 0, 115, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60001, 4, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 116, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("スズメ", 0, 60001, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, 112101, 117, 0, 3, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("スズメ", 0, 60001, 0, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 7, 112101, 118, 0, 3, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "ヒューヒュー♪\nドンドンパフパフー♪", 1, 105801, 119, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 105901, 120, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 105901, 121, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "え？　ちょっと\nいきなりなにっ？", 1, 106001, 122, 0, 2, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 1, 106001, 123, 0, 2, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 1, 105801, 124, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 1, 105801, 125, 0, 0, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 105901, 126, 0, 1, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 1, 106001, 127, 0, 2, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 105901, 128, 0, 1, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 1, 105801, 129, 0, 0, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 1, 106001, 130, 0, 2, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 105901, 131, 0, 1, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 2, 106001, 132, 0, 0, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 2, 190801, 133, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "げっ…カリンじゃない\nなんでもないわよ！", 2, 106001, 134, 0, 0, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, 190801, 135, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 2, 106001, 136, 0, 0, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 2, 190801, 137, 0, 1, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 2, 106001, 138, 0, 0, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 2, 106001, 139, 0, 0, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 2, 190801, 140, 0, 1, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 2, 106001, 141, 0, 0, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 2, 190801, 142, 0, 1, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 2, 106001, 143, 0, 0, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 3, 105901, 144, 0, 0, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 3, 105801, 145, 0, 1, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 3, 105901, 146, 0, 0, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 3, 105901, 147, 0, 0, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 3, 105801, 148, 0, 1, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 3, 105801, 149, 0, 1, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 3, 105901, 150, 0, 0, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 3, 105801, 151, 0, 1, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 3, 105901, 152, 0, 0, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "えへへ、ありがとうございます\nコッコロちゃん！", 3, 105801, 153, 0, 1, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 3, 105901, 154, 0, 0, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 3, 105801, 155, 0, 1, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 4, 105801, 156, 0, 0, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 4, 106001, 157, 0, 1, "", 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 4, 105801, 158, 0, 0, "", 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 4, 106001, 159, 0, 1, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 4, 105801, 160, 0, 0, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "…積極的？\nなんの話よ？", 4, 106001, 161, 0, 1, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 4, 105801, 162, 0, 0, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 4, 105801, 163, 0, 0, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 4, 106001, 164, 0, 1, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 4, 105801, 165, 0, 0, "", 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 4, 106001, 166, 0, 1, "", 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 4, 106001, 167, 0, 1, "", 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 5, 106001, 168, 0, 0, "", 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 5, 105901, 169, 0, 1, "", 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 5, 106001, 170, 0, 0, "", 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 5, 105901, 171, 0, 1, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 5, 106001, 172, 0, 0, "", 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 5, 105901, 173, 0, 1, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 5, 106001, 174, 0, 0, "", 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 5, 105901, 175, 0, 1, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "かくし芸？", 5, 106001, 176, 0, 0, "", 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 5, 105901, 177, 0, 1, "", 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 5, 106001, 178, 0, 0, "", 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 6, 105801, 179, 0, 0, "", 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 6, 106001, 180, 0, 2, "", 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 6, 105901, 181, 0, 1, "", 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 6, 105801, 182, 0, 0, "", 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 6, 106001, 183, 0, 2, "", 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 6, 105901, 184, 0, 1, "", 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 6, 106001, 185, 0, 2, "", 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 6, 106001, 186, 0, 2, "", 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 6, 106001, 187, 0, 2, "", 28);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 6, 105801, 188, 0, 0, "", 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 6, 105901, 189, 0, 1, "", 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 6, 106001, 190, 0, 2, "", 29);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 7, 106001, 191, 0, 0, "", 30);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 7, 106001, 192, 0, 0, "", 31);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 7, 106001, 193, 0, 0, "", 32);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "あー\nあー\n…声、これで大丈夫かしら？", 7, 106001, 194, 0, 0, "", 33);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 7, 106001, 195, 0, 0, "", 34);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "オイッスー☆", 7, 106001, 196, 0, 0, "", 35);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 7, 106001, 197, 0, 0, "", 36);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 7, 106001, 198, 0, 0, "", 37);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 7, 106001, 199, 0, 0, "", 38);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 8, 105901, 200, 0, 0, "", 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 8, 105901, 201, 0, 0, "", 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 8, 105901, 202, 0, 0, "", 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 8, 105901, 203, 0, 0, "", 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 8, 105901, 204, 0, 0, "", 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "オイッスー☆", 8, 105901, 205, 0, 0, "", 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 8, 105901, 206, 0, 0, "", 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 8, 105901, 207, 0, 0, "", 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 8, 105901, 208, 0, 0, "", 28);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "オイッスー☆", 9, 105801, 209, 0, 0, "", 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 9, 105801, 210, 0, 0, "", 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "あと６日で2.5周年ですか…", 9, 105801, 211, 0, 0, "", 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 9, 105801, 212, 0, 0, "", 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 9, 105801, 213, 0, 0, "", 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "オイッスー☆", 9, 105801, 214, 0, 0, "", 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 9, 105801, 215, 0, 0, "", 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 9, 105801, 216, 0, 0, "", 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 9, 105801, 217, 0, 0, "", 28);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 9, 105801, 218, 0, 0, "", 29);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 9, 105801, 219, 0, 0, "", 30);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 10, 105801, 220, 0, 0, "", 31);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 10, 105901, 221, 0, 1, "", 29);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 10, 105801, 222, 0, 0, "", 32);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "…………", 10, 106001, 223, 0, 2, "", 39);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 10, 105901, 224, 0, 1, "", 30);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 10, 106001, 225, 0, 2, "", 40);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 10, 105801, 226, 0, 0, "", 33);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 10, 106001, 227, 0, 2, "", 41);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 10, 105801, 228, 0, 0, "", 34);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 10, 105801, 229, 0, 0, "", 35);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 10, 106001, 230, 0, 2, "", 42);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 10, 105901, 231, 0, 1, "", 31);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 10, 106001, 232, 0, 2, "", 43);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 10, 105801, 233, 0, 0, "", 36);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 11, 190801, 234, 0, 0, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 11, 190801, 235, 0, 0, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 11, 190801, 236, 0, 0, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 11, 190801, 237, 0, 0, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 11, 190801, 238, 0, 0, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "次にコッコロさんですが\nこちらは発声練習をしています", 11, 190801, 239, 0, 0, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 11, 190801, 240, 0, 0, "", 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 11, 190801, 241, 0, 0, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "あれ？\nもしかして緊張で気を失って…？", 11, 190801, 242, 0, 0, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 11, 190801, 243, 0, 0, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 11, 190801, 244, 0, 0, "", 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "それでは\nまた明日お会いしましょう♪", 11, 190801, 245, 0, 0, "", 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 12, 106001, 246, 0, 0, "", 44);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 12, 105801, 247, 0, 2, "", 37);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 12, 105901, 248, 0, 1, "", 32);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 12, 106001, 249, 0, 0, "", 45);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "ひどいですよぉキャルちゃ～ん！", 12, 105801, 250, 0, 2, "", 38);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 12, 105901, 251, 0, 1, "", 33);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 12, 105801, 252, 0, 2, "", 39);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 12, 106001, 253, 0, 0, "", 46);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 12, 105901, 254, 0, 1, "", 34);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 12, 105801, 255, 0, 2, "", 40);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 13, 105801, 256, 0, 0, "", 41);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 13, 106001, 257, 0, 2, "", 47);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "忘れてきちゃいました☆", 13, 105801, 258, 0, 0, "", 42);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 13, 106001, 259, 0, 2, "", 48);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 13, 105901, 260, 0, 1, "", 35);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 13, 106001, 261, 0, 2, "", 49);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 13, 105801, 262, 0, 0, "", 43);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 13, 106001, 263, 0, 2, "", 50);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 13, 105901, 264, 0, 1, "", 36);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 13, 106001, 265, 0, 2, "", 51);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 13, 105901, 266, 0, 1, "", 37);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 13, 106001, 267, 0, 2, "", 52);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 13, 105801, 268, 0, 0, "", 44);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 13, 105901, 269, 0, 1, "", 38);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 13, 105801, 270, 0, 0, "", 45);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 13, 106001, 271, 0, 2, "", 53);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 13, 105801, 272, 0, 0, "", 46);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "こんにちは\n【ギルド管理協会】のカリンです", 14, 190801, 273, 0, 0, "", 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "昨日の生放送は\nいかがだったでしょうか？", 14, 190801, 274, 0, 0, "", 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 14, 190801, 275, 0, 0, "", 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 14, 190801, 276, 0, 0, "", 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 14, 190801, 277, 0, 0, "", 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 14, 190801, 278, 0, 0, "", 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 14, 190801, 279, 0, 0, "", 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 14, 190801, 280, 0, 0, "", 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 14, 190801, 281, 0, 0, "", 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80003, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 14, 190801, 282, 0, 0, "", 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "準備はいいですかっ？\n…いっきますよー！", 15, 105801, 283, 0, 0, "", 47);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "祝！", 15, 106001, 284, 0, 2, "", 54);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "2.5周年！", 15, 105901, 285, 0, 1, "", 39);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "おめでとうございま～す☆", 15, 105801, 286, 0, 0, "", 48);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 15, 106001, 287, 0, 2, "", 55);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 15, 105901, 288, 0, 1, "", 40);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 15, 105801, 289, 0, 0, "", 49);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 15, 106001, 290, 0, 2, "", 56);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 15, 105901, 291, 0, 1, "", 41);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 15, 106001, 292, 0, 2, "", 57);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 15, 105801, 293, 0, 0, "", 50);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 15, 106001, 294, 0, 2, "", 58);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "記念日だから\n平気平気♪\nやばいですね☆", 15, 105801, 295, 0, 0, "", 51);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "意味分かんないわよ！", 15, 106001, 296, 0, 2, "", 59);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 15, 105901, 297, 0, 1, "", 42);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 15, 105901, 298, 0, 1, "", 43);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 15, 105801, 299, 0, 0, "", 52);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80003, 0, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 15, 106001, 300, 0, 2, "", 60);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80003, 0, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 15, 105901, 301, 0, 1, "", 44);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80003, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 15, 105801, 302, 0, 0, "", 53);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ・コッコロ・キャル", 1, 80003, 0, "2.5周年\nありがとうございます！", 15, 105801, 303, 0, 0, "105901,45,106001,61", 54);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60002, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804, 304, 1, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 305, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 306, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 307, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 308, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 1, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 309, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 310, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 311, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 312, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 313, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 314, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 3, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 315, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 3, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 316, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 3, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 317, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 3, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 318, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 3, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 0, 319, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 3, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 320, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 3, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 0, 321, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 4, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 322, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 4, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, 323, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 4, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, 324, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 4, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 325, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 4, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 326, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 4, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, 327, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60002, 4, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 328, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60002, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, 329, 0, 3, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60002, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 190804, 330, 0, 3, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "ささ、シェフィさまはこちらへ…", 1, 105901, 331, 0, 4, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "コッコロさん、どこへ行くの…？\n…え？", 1, 106401, 332, 0, 0, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, 105801, 333, 0, 3, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 1, 105901, 334, 0, 4, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "ええと…\n二人とも何をしているの？", 1, 106401, 335, 0, 0, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 106001, 336, 0, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "あの日…？", 1, 106401, 337, 0, 0, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 1, 105801, 338, 0, 3, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 1, 105801, 339, 0, 3, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "やばいですね☆", 1, 190801, 340, 0, 2, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "って、なにしれっと\n参加してんのよカリン！", 1, 106001, 341, 0, 1, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 1, 190801, 342, 0, 2, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 1, 190801, 343, 0, 2, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 1, 105801, 344, 0, 3, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 1, 106401, 345, 0, 0, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 2, 105801, 346, 0, 3, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 2, 105901, 347, 0, 1, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 2, 105901, 348, 0, 1, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 2, 105801, 349, 0, 3, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "さすがでございます\nペコリーヌさま", 2, 105901, 350, 0, 1, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 2, 106001, 351, 0, 0, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 106401, 352, 0, 2, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 2, 105801, 353, 0, 3, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "さ、次はキャルさまの\n番でございますよ", 2, 105901, 354, 0, 1, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 2, 106001, 355, 0, 0, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 106401, 356, 0, 2, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 2, 106001, 357, 0, 0, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 2, 106001, 358, 0, 0, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 2, 105901, 359, 0, 1, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 2, 106001, 360, 0, 0, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 3, 105901, 361, 0, 1, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 105801, 362, 0, 3, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 3, 105901, 363, 0, 1, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "聖学祭…って、なにかしら？", 3, 106401, 364, 0, 2, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 3, 105901, 365, 0, 1, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 3, 106001, 366, 0, 0, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 3, 106001, 367, 0, 0, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 105801, 368, 0, 3, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "いや、そのまんますぎでしょ…", 3, 106001, 369, 0, 0, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 3, 106401, 370, 0, 2, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 105801, 371, 0, 3, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "えっ？　ええ…\nぎゅーっ…？", 3, 106401, 372, 0, 2, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 4, 106001, 373, 0, 0, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 4, 106401, 374, 0, 2, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 4, 106001, 375, 0, 0, "", 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 4, 105901, 376, 0, 1, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 4, 106001, 377, 0, 0, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 4, 105801, 378, 0, 3, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 4, 106001, 379, 0, 0, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 4, 106001, 380, 0, 0, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 4, 106401, 381, 0, 2, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 4, 105801, 382, 0, 3, "", 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 4, 105901, 383, 0, 1, "", 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 4, 106001, 384, 0, 0, "", 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 4, 106401, 385, 0, 2, "", 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 5, 105801, 386, 0, 3, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 5, 105801, 387, 0, 3, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 5, 105801, 388, 0, 3, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 5, 106001, 389, 0, 0, "", 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 5, 106001, 390, 0, 0, "", 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 5, 106401, 391, 0, 2, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 5, 105901, 392, 0, 1, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 5, 105801, 393, 0, 3, "", 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 5, 106001, 394, 0, 0, "", 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 5, 105801, 395, 0, 3, "", 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 5, 105801, 396, 0, 3, "", 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 5, 105801, 397, 0, 3, "", 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 6, 190801, 398, 0, 2, "", 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 6, 190801, 399, 0, 2, "", 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "…えっ！？", 6, 106001, 400, 0, 1, "", 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 6, 105801, 401, 0, 3, "", 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 6, 106401, 402, 0, 0, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 6, 105901, 403, 0, 4, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 6, 106401, 404, 0, 0, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 6, 106001, 405, 0, 1, "", 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 6, 105801, 406, 0, 3, "", 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "ぶっ殺すぞ！？", 6, 106001, 407, 0, 1, "", 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, 190801, 408, 0, 2, "", 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 7, 105901, 409, 0, 1, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 7, 106001, 410, 0, 0, "", 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 7, 106401, 411, 0, 2, "", 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 7, 105801, 412, 0, 3, "", 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 7, 106001, 413, 0, 0, "", 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 7, 106401, 414, 0, 2, "", 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 7, 105901, 415, 0, 1, "", 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 7, 106401, 416, 0, 2, "", 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "もちろんでございます\n仲良くお勉強いたしましょう", 7, 105901, 417, 0, 1, "", 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "しれっと教育ママが\n生まれてる…？", 7, 106001, 418, 0, 0, "", 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 7, 105801, 419, 0, 3, "", 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "え～～～～！？", 7, 106001, 420, 0, 0, "", 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 8, 106001, 421, 0, 0, "", 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 8, 106401, 422, 0, 2, "", 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 8, 105901, 423, 0, 1, "", 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 8, 105801, 424, 0, 3, "", 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 8, 106401, 425, 0, 2, "", 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 8, 106001, 426, 0, 0, "", 28);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 8, 105901, 427, 0, 1, "", 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 8, 106401, 428, 0, 2, "", 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 8, 106001, 429, 0, 0, "", 29);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 8, 106001, 430, 0, 0, "", 30);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 8, 105801, 431, 0, 3, "", 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 8, 106001, 432, 0, 0, "", 31);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 9, 106401, 433, 0, 0, "", 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 9, 106401, 434, 0, 0, "", 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 9, 106401, 435, 0, 0, "", 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 9, 106401, 436, 0, 0, "", 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 9, 106401, 437, 0, 0, "", 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "それから、それから…！\nぅ、ぅぅっ…！", 9, 106401, 438, 0, 0, "", 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "―びえぇぇ～んっ！！！", 9, 106401, 439, 0, 0, "", 28);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "どうされましたか、シェフィさま", 9, 105901, 440, 0, 1, "", 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "ううっ…ひっく…\nママッ…！", 9, 106401, 441, 0, 0, "", 29);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 9, 105901, 442, 0, 1, "", 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 9, 105901, 443, 0, 1, "", 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 9, 106401, 444, 0, 0, "", 30);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "主さま\n3.5周年まであと５日\nでございます", 10, 105901, 445, 0, 0, "", 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "ですがその前に\n生放送がありますね", 10, 105901, 446, 0, 0, "", 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "…生放送に向けた\n意気込みでございますか？", 10, 105901, 447, 0, 0, "", 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 10, 105901, 448, 0, 0, "", 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 10, 105901, 449, 0, 0, "", 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 10, 105901, 450, 0, 0, "", 28);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 10, 105901, 451, 0, 0, "", 29);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 10, 105901, 452, 0, 0, "", 30);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 10, 105901, 453, 0, 0, "", 31);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "3.5周年まであと４日！\nやばいですね☆", 11, 105801, 454, 0, 0, "", 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 11, 106001, 455, 0, 1, "", 32);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 11, 105801, 456, 0, 0, "", 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 11, 105801, 457, 0, 0, "", 28);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 11, 105801, 458, 0, 0, "", 29);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 11, 106001, 459, 0, 1, "", 33);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 11, 105801, 460, 0, 0, "", 30);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 11, 105801, 461, 0, 0, "", 31);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 11, 105801, 462, 0, 0, "", 32);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "だからあたしはやるなんて一言も…", 11, 106001, 463, 0, 1, "", 34);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "オイッスー☆", 11, 105801, 464, 0, 0, "", 33);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "聞きなさいっての！！", 11, 106001, 465, 0, 1, "", 35);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "3.5周年まであと３日…\nそして生放送は、明日…", 12, 106401, 466, 0, 2, "", 31);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 12, 106401, 467, 0, 2, "", 32);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "おいっす！\n…こうじゃなかったわね\nええと確か…", 12, 106401, 468, 0, 2, "", 33);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 12, 106401, 469, 0, 2, "", 34);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 12, 106401, 470, 0, 2, "", 35);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "やってますねシェフィちゃん！", 12, 105801, 471, 0, 3, "", 34);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "なによ、考えることは\nみんな同じってこと？", 12, 106001, 472, 0, 0, "", 36);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 12, 105901, 473, 0, 1, "", 32);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "みんな…もちろんよ！", 12, 106401, 474, 0, 2, "", 36);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 12, 105801, 475, 0, 3, "", 35);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 13, 190801, 476, 0, 2, "", 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 13, 190801, 477, 0, 2, "", 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 13, 105801, 478, 0, 3, "", 36);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 13, 190801, 479, 0, 2, "", 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 13, 105901, 480, 0, 4, "", 33);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 13, 190801, 481, 0, 2, "", 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "大丈夫…大丈夫…\nあたしは大丈夫…", 13, 106001, 482, 0, 1, "", 37);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 13, 190801, 483, 0, 2, "", 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "あうー？", 13, 106401, 484, 0, 0, "", 37);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("みんな", 1, 80005, 0, "あ…", 13, 105801, 485, 0, 4, "105901,34,106001,38,190801,12", 37);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 13, 106001, 486, 0, 1, "", 39);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 13, 105901, 487, 0, 4, "", 35);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 13, 105801, 488, 0, 3, "", 38);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, 190801, 489, 0, 2, "", 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 14, 106401, 490, 0, 2, "", 38);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 14, 105801, 491, 0, 3, "", 39);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 14, 106001, 492, 0, 0, "", 40);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 14, 105901, 493, 0, 1, "", 36);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 14, 106401, 494, 0, 2, "", 39);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 14, 105801, 495, 0, 3, "", 40);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 14, 105901, 496, 0, 1, "", 37);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 14, 106001, 497, 0, 0, "", 41);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "へ、へぇ…", 14, 106401, 498, 0, 2, "", 40);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 14, 105801, 499, 0, 3, "", 41);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 14, 106401, 500, 0, 2, "", 41);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 14, 106401, 501, 0, 2, "", 42);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 15, 105801, 502, 0, 3, "", 42);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "祝！", 15, 106001, 503, 0, 1, "", 42);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "3.5周年！", 15, 105901, 504, 0, 4, "", 38);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "おめでとうございます！", 15, 106401, 505, 0, 0, "", 43);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 15, 190801, 506, 0, 2, "", 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 80005, 0, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, 190801, 507, 0, 2, "", 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 15, 105801, 508, 0, 3, "", 43);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 15, 105801, 509, 0, 3, "", 44);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 15, 106001, 510, 0, 1, "", 43);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("キャル", 0, 80005, 0, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 15, 106001, 511, 0, 1, "", 44);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 15, 106401, 512, 0, 0, "", 44);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("シェフィ", 0, 80005, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 15, 106401, 513, 0, 0, "", 45);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 15, 105901, 514, 0, 4, "", 39);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 15, 105901, 515, 0, 4, "", 40);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("コッコロ", 0, 80005, 0, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 15, 105901, 516, 0, 4, "", 41);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("ペコリーヌ", 0, 80005, 0, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 15, 105801, 517, 0, 3, "", 45);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("みんな", 1, 80005, 0, "これからも\nよろしくおねがいします！", 15, 105801, 518, 0, 4, "105901,42,106001,45,106401,46,190801,16", 46);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60003, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804, 519, 1, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 520, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 521, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 1, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0, 522, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 1, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 0, 523, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 1, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 524, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 525, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 526, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 2, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 0, 527, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 2, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 0, 528, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 529, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 3, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 530, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 3, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 531, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 3, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 532, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 3, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 533, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 3, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 0, 534, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 3, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 535, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 3, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 0, 536, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 4, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 537, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 4, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, 538, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 4, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, 539, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 4, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0, 0, 540, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 4, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 541, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 4, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, 542, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60003, 4, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 0, 0, 543, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60003, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, 544, 0, 3, "", 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60003, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 190804, 545, 0, 3, "", 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("カリン", 0, 60004, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804, 546, 1, 1, "", 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 547, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 1, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0, 548, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 1, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 0, 0, 549, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 1, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 0, 0, 550, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 1, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 551, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 552, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 553, 2, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 2, "今日の運勢は大吉！　ラッキーワードは「ぴょんぴょん♪」\nおっきな声で一緒に言ってみよ～♪　うさぎさんぴょんぴょ～ん♪", 0, 0, 554, 1, 2, "", 0);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES ("", 0, 60004, 2, "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 0, 0, 555, 1, 2, "", 0);
